import React from "react";
import Title from "./Title";
import Input from "./Input";
import Item from "./Item";


export default function Todo({handlechangeData, handlechangeDate}) {
    const todoItems =[
        {
            name:handlechangeData,
            dueDate:handlechangeDate
        }
        
    ]
  return (
    <>
      <Title heading={'Todo App'} react={'(ReactApp)'} />
      <div className="row mt-4">
         <Input handlechangeData={handlechangeData} handlechangeDate={handlechangeDate}/>
      </div>
      <div className="row">
        <Item todoItems={todoItems}/>
      </div>
    </>
  );
}
